import { Link, Route, Routes } from "react-router-dom";
import "./App.css";
import List from "./components/List/List";
import Login from "./components/Login/Login";
import NavBar from "./components/NavBar/NavBar";
import ListBlog from "./components/Blog/ListBlog";
import SignUp from "./components/SignUp/SignUp";

function App() {
  return (
    <div>
      <Routes>
        <Route
          path="/"
          element={
            <div>
              <NavBar />
              <List />
            </div>
          }
        />
        <Route
          path="/Home"
          element={
            <div>
              <NavBar />
              <List />
            </div>
          }
        />

        <Route
          path="/login"
          element={
            <div>
              <NavBar />
              <Login />
            </div>
          }
        />
        <Route
          path="/register"
          element={
            <div>
              <NavBar />
              <SignUp />
            </div>
          }
        />
        <Route
          path="/blog"
          element={
            <div>
              <NavBar />
              <ListBlog />
            </div>
          }
        />

      </Routes>
    </div>
  );
}

export default App;
